window.bookSummaryJSON = "<p><b>When I run, he always chases.</b></p> <p>Where I go, he always follows. Primal, Powerful, Possessive. Aleksandr Romanov is my nemesis...</p> <p>And my new husband.</p> <p>He thinks I'm the spoiled mafia princess. That I have the world at my fingertips. I may be his new wife, but he doesn't know the real me.</p> <p>No one does.</p> <p>But when Aleksandr touches me, he cuts me wide open as if trying to see the secrets I hide.</p> <p>Every touch becomes foreplay, every look stokes our passion. Our hatred turns to obsession.</p> <p>But when he unearths the secrets I've kept well hidden from the world… I have nowhere left to hide. No one to save me from the truth; no one to save me from my enemies…</p> <p>No one to save me from the only man I've ever loved.</p> <p>Sanctum <i>is a standalone dark bratva, arranged marriage romance with a fiery, quick-witted heroine, and an irascible, smoldering-hot hero with a \"look at her and I'll destroy you\" spirit. No cliffhanger. HEA included. Narrated in duet style.</i></p>"; 
